import pygame, random
import base64
import io
import pygame_engine as pge 

BLOCK_SIZE, COLS, ROWS = 20, 20, 20
SCREEN_W, SCREEN_H = 400, 400
Engine = pge.PyGameEngine((SCREEN_W, SCREEN_H), "JASG!", debug=False)

data = {"max_score": 0, "theme": "black"}
data_path = f"{pge.SavesManager.get_appdata()}/data"
if pge.SavesManager.load(data_path): data = pge.SavesManager.load(data_path) 

STARTED_GAME = True
GAME_SPEED = 0.18

sounds = {"eat": "",
          "death": ""}


class coord:
    __slots__ = ("x", "y")
    def __init__(self, x: int, y: int):
        self.x, self.y = x, y

    @property
    def pos(self): return self.x, self.y
    def mult(self, v): return coord(self.x*v, self.y*v)
    def __add__(self, o): return coord(self.x+o.x, self.y+o.y)
    def __eq__(self, o): return isinstance(o, coord) and self.pos == o.pos

class Snake(pge.Sprite):
    def __init__(self):
        super().__init__()

        self.score = 1
        self.body = [coord(random.randrange(ROWS), random.randrange(COLS))]
        self.speed = coord(0, 1)
        self.pending_direction = self.speed
        self.movement_cooldown = Engine.Time.Cooldown(GAME_SPEED).start()

        self.generate_apple()

        # eyes
        b = BLOCK_SIZE
        o, e = b//4, b//5
        self.eye_map = {
            ( 1, 0): [(b-o-e, o),          (b-o-e, b-o-e)],
            (-1, 0): [(o, o),              (o, b-o-e)],
            (0,  1): [(o, b-o-e),          (b-o-e, b-o-e)],
            (0, -1): [(o, o),              (b-o-e, o)]
        }

    # -----------------------------
    # APPLE
    # -----------------------------
    def generate_apple(self):
        while True:
            apple = coord(random.randrange(ROWS), random.randrange(COLS))
            if apple not in self.body:
                self.apple = apple
                return

    # -----------------------------
    # DRAW
    # -----------------------------
    def draw(self):
        ax, ay = self.apple.mult(BLOCK_SIZE).pos
        pygame.draw.rect(self.screen, "red", (ax, ay, BLOCK_SIZE, BLOCK_SIZE))

        for i, part in enumerate(self.body):
            px, py = part.mult(BLOCK_SIZE).pos
            pygame.draw.rect(self.screen, "green", (px, py, BLOCK_SIZE, BLOCK_SIZE))

            if i == 0:
                for ex, ey in self.eye_map[self.speed.pos]:
                    pygame.draw.rect(
                        self.screen,
                        "black",
                        (px + ex, py + ey, BLOCK_SIZE//5, BLOCK_SIZE//5)
                    )

    # -----------------------------
    # UPDATE
    # -----------------------------
    def update(self):
        self.draw()

        if not self.alive:
            Engine.set_active_scene(MENU)
            return
        dirs = {
            pygame.K_w: coord(0, -1), pygame.K_UP: coord(0, -1),
            pygame.K_s: coord(0, 1),  pygame.K_DOWN: coord(0, 1),
            pygame.K_a: coord(-1, 0), pygame.K_LEFT: coord(-1, 0),
            pygame.K_d: coord(1, 0),  pygame.K_RIGHT: coord(1, 0)
        }
        for k, d in dirs.items():
            if Engine.Input.key_hold(k):
                if not (d.x == -self.speed.x and d.y == -self.speed.y):
                    self.pending_direction = d
                break

        # --- MOVEMENT ---
        if not self.movement_cooldown.check():
            return

        self.movement_cooldown.start()
        self.speed = self.pending_direction
        new_head = self.body[0] + self.speed

        if new_head == self.apple:
            self.body = [new_head] + self.body
            self.score += 1
            if self.score > data["max_score"]:
                data["max_score"] = self.score
            self.generate_apple()
            pge.SoundManager.play_path_sound(io.BytesIO(base64.b64decode(sounds["eat"])))
            return

        # collision
        if (
            new_head in self.body or
            not (0 <= new_head.x < COLS) or
            not (0 <= new_head.y < ROWS)
        ):
            self.kill()
            pge.SoundManager.play_path_sound(io.BytesIO(base64.b64decode(sounds["death"])))
            return

        # normal movement
        self.body = [new_head] + self.body[:-1]


MAIN = pge.Scene()
with MAIN.content:
    snake = Snake()

@MAIN.define
def main():
    Engine.screen.fill(data["theme"])
    MAIN.update_all()
    pge.render_text(f"{snake.score} : {data['max_score']}", SCREEN_W/2, 29, size=25, center=True, color= ("black" if data["theme"] == "white" else "white"))

MENU = pge.Scene()
@MENU.define
def menu():
    global STARTED_GAME, snake
    Engine.screen.fill(data["theme"])

    if STARTED_GAME:
        pge.render_text("J A S G !", SCREEN_W/2, SCREEN_H/2-50, size=64, center=True, color= ("black" if data["theme"] == "white" else "white"), font="ComicSans")
        pge.render_text(f"MAX SCORE: {data['max_score']}", SCREEN_W/2, SCREEN_H/2+50, size=32, center=True, color= ("black" if data["theme"] == "white" else "white"), font="ComicSans")
        if Engine.Input.key_pressed(pygame.K_SPACE) or Engine.Input.mouse_pressed():
            snake = Snake()
            MAIN.objects = [snake]
            Engine.set_active_scene(MAIN)

Engine.run(MENU)
pge.SavesManager.save(data_path, data)